import AboutUs from "./AboutUs";
import Home from "./Home";
import Products from "./Products";

function HomePage() {
  const getDet = () => {
    fetch("http://localhost:8080/details")
      .then((response) => response.json())
      .then((allDet) => console.log(allDet));
  };

  useEffect(() => {
    getDet();
  }, [true]);
  return <div>
    <Home />
    <Products />
    <AboutUs />
  </div>
}
export default HomePage;
